import * as $ from "jquery";
import Client from "phaseweb/client";
import Events from "phaseweb/pagemodel/settings/events";
import * as Templates from "phaseweb/pagemodel/settings/templates";

class Settings {
    private _client: Client;

    constructor(client: Client) {
        this._client = client;
        $("body").prepend(Templates.default);
    }
}

export default Settings;
